import fetch from 'isomorphic-unfetch'; // For fetch API
import Head from 'next/head';
// import { Component } from 'react';
// import Link from 'next/link';
// import Layout from './MyLayout';
// import { post } from 'axios';

export default class InstructorSchedule extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		console.log('Prop is ' + this.props.value);

		if (this.props.value === 'Bianca') {
			return (
				<div>
					<Head>
						<title>Yoga Kickstarter</title>
						<link
							rel="stylesheet"
							href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
						/>
					</Head>
					{/* {this.props.value}'s Schedule */}
					<div className="box">Mondays 7pm - 8pm</div>
					<div className="box">Wednesdays 7-8pm</div>
					<style jsx>
						{`
							.box {
								border: 1px solid black;
							}
						`}
					</style>
				</div>
			);
		} else if (this.props.value === 'Suffian') {
			return (
				<div>
					<Head>
						<title>Yoga Kickstarter</title>
						<link
							rel="stylesheet"
							href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
						/>
					</Head>;
					<h1>{this.props.value}'s Schedule</h1>
				</div>
			);
		} else {
			return (
				<div>
					<Head>
						<title>Yoga Kickstarter</title>
						<link
							rel="stylesheet"
							href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
						/>
					</Head>;
					<h1>{this.props.value}'s Schedule</h1>
				</div>
			);
		}
	}
}
